import React from 'react'
import studentImg from '../images/alumno.png'

class Card extends React.Component{
    render(){
        return(
            <div className="card">
                <div className="imagen">
                    <img src={studentImg} width="250px" height="250px"/>
                </div>
                <div className="Fitness-Card-Info">
                    <h1>Alumno</h1>
                    <p>Haz click aqu√≠ si eres alumno</p>
                </div>
            </div>
        )
    }
}

export default Card;
